import React from "react";
import "./portfolio.css";

const Portfolio = () => {
  const projects = [
    {
      id: 1,
      title: "Project One",
      description:
        "A brief description of your first project and its key features.",
      image: "https://via.placeholder.com/300x200",
      technologies: ["React", "Node.js", "MongoDB"],
      link: "#",
    },
    {
      id: 2,
      title: "Project Two",
      description:
        "A brief description of your second project and its key features.",
      image: "https://via.placeholder.com/300x200",
      technologies: ["JavaScript", "Express", "PostgreSQL"],
      link: "#",
    },
    {
      id: 3,
      title: "Project Three",
      description:
        "A brief description of your third project and its key features.",
      image: "https://via.placeholder.com/300x200",
      technologies: ["Python", "Django", "MySQL"],
      link: "#",
    },
  ];

  return (
    <section className="portfolio-section" id="portfolio">
      <div className="portfolio-container">
        <h2 className="section-title">My Portfolio</h2>
        <div className="projects-grid">
          {projects.map((project) => (
            <div className="project-card" key={project.id}>
              <div className="project-image">
                <img src={project.image} alt={project.title} />
              </div>
              <div className="project-content">
                <h3>{project.title}</h3>
                <p>{project.description}</p>
                <div className="technologies">
                  {project.technologies.map((tech, index) => (
                    <span key={index} className="tech-tag">
                      {tech}
                    </span>
                  ))}
                </div>
                <a
                  href={project.link}
                  className="project-link"
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  View Project
                </a>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Portfolio;
